import React, { Component } from 'react';
import "./style.css";
import Header from '../../components/Header';
import Hamburguer from '../../assets/images/hamburguer';
import Drawer from '../../components/SideMenu';
import Conteudo from './components/Conteudo';
import Enunciado from './components/Enunciado';
import Pontuacao from './components/Pontuacao';
import Prazo from './components/Prazo';
import BotaoFazer from './components/BotaoFazer';



class Avaliacao extends Component {

    render = () => {
        return(
            <>
            <Header drawer={true} icon={<Hamburguer />} title={"Atividade"}></Header>
            <Drawer></Drawer>
            <div className={"title-container"}>
                <p className={"title"}> Nome da Atividade </p>
            </div>
            <div className={"row"}>
                <div className={"col"} style={{justifyContent:'flex-end',alignItems:'flex-end', width:100}}>
                    <BotaoFazer></BotaoFazer>   
                </div>
            </div>
            </>
        )
    }

}
export default Avaliacao;
